import React from 'react';
import classes from './Post.module.css';

const Post = (props) => {
    return (
        <div className={classes.item}>
            <img
                src="data:image/jpeg;base64,"
                alt=""/>
            {props.message}
            <div>

            </div>
            <div>
                <span>likes</span> {props.likesCount}
            </div>
        </div>
    )
}

export default Post;
